import React, {useEffect, useState} from "react";

interface User {
    users: string[]
}

function App() {
    const [data, setData] = useState<User>({users: []});

    useEffect(() => {
        fetch("/api").then(
            response => response.json()
        ).then(
            data => {
                setData(data)
            }
        )
    }, [])

    return (
        <div>
            {data.users.map((user, i) => {
                return <p key={i}>{user}</p>
            })}
        </div>
    )
}

export default App
